function serviceHealthList(html) {

    var list = html.split('\n');
  	var subjectAlert = false;
    var data = {
      	"subject": "Microsoft 365 Service Health Report",
        "allServices": {
            "length": (list.length/2),
            "items": []
        }
    };
    for (var i = 0; i < (list.length - 1); i = i + 2) {
        var elementName = list[i];
        var elementStat = list[i + 1];

        if (elementName && elementStat) {

            var item = {
                        "service": list[i],
                        "status": (list[i + 1]).slice(1),
                        "incident": false,
              			"advisory": false
                    };
            var style = '';

            if ((elementStat.search('incident') > 0)) {
                style = 'color: red';
                item.incident = true;
              	subjectAlert = true;
            }


          	if((elementStat.search('advisor') > 0)){
                style = 'color: red';
                item.advisory = true;              
            }

          	if(item.incident == false && item.advisory == false){
                style = 'color: green';
            }

            item.message = "<b>"+list[i]+"</b> - <span style='"+style+"'>"+item.status+"</span><br/>";

            data.allServices.items.push(item);
        }



    }

  if(subjectAlert == true){
    data.subject = "[INCIDENT DETECTED] " + data.subject;
  }

    return JSON.stringify(data);
}

