function MountIncidentsObject(arguments) {

    var list = arguments[0].split('\n');
    var svListObjectStringifyed = JSON.parse(arguments[1]);
    svListObjectStringifyed['allIncidents'] = {
            "length": (list.length/7),
            "items": []
    };
    for (var i = 0; i < (list.length - 1); i = i + 7) {
        var elementName = list[i];
        var elementStat = list[i + 1];

        if (elementName && elementStat) {

            var item = {
                        "title": list[i],
                        "service": list[i + 1],
                        "issue_origin": list[i + 2],
                        "id": list[i + 3],
                        "status": list[i + 4],
                        "start_time": list[i + 5],
                        "last_updated": list[i + 6]
                    };

            svListObjectStringifyed.allIncidents.items.push(item);
        }

    }

    return JSON.stringify(svListObjectStringifyed);
}

