function createMailMessage(obj) {
   var data = JSON.parse(obj);

   var mailMessage = "<img alt='AbInbev' width='242px' height='106px' style='margin: 0; padding: 0; vertical-align: middle;' src='data:image/jpeg;base64,' /><br/>";

   for (var objInd = 0; objInd < data.allServices.items.length; objInd++) {
      var service = data.allServices.items[objInd];
      mailMessage += "<h3>" + service.message + "</h3>";

      if (service.incident == true) {
         mailMessage += '<br/><h4><b>Incidents</b></h4><br/>';

         for (var incInd = 0; incInd < data.allIncidents.items.length; incInd++) {
            var incident = data.allIncidents.items[incInd];
            if (service.service == incident.service) {
               var text = incident.text;
               mailMessage += text;
               mailMessage += '<br/>----------------------------------------<br/>';
            }
         }
      }
      if (service.advisory == true) {
         mailMessage += '<br/><h4><b>Advisories</b></h4><br/>';

         for (var AdvInd = 0; AdvInd < data.allAdvisories.items.length; AdvInd++) {
            var advisory = data.allAdvisories.items[AdvInd];
            if (service.service == advisory.service) {
               var text = advisory.text;
               mailMessage += text;
               mailMessage += '<br/>----------------------------------------<br/>';
            }
         }
      }
      mailMessage += '<hr>';
   }

   return mailMessage;

}
